        require(mintAmount <= nftsAvailable(), "GoldenNFTPresale: not enough NFTs available");
        for (uint256 i = 0; i < mintAmount; i++) {
            _mintToken(_msgSender());
        }
    }
    function adminMintTo(address receiver) public onlyOwner {
        _mintToken(receiver);
    }

    function _mintToken(address destinationAddress) internal {
        uint256 newTokenID = totalSupply();
        require(!_exists(newTokenID), "GoldenNFTPresale: Token already exist.");
        _safeMint(destinationAddress, newTokenID);
    }

